CREATE OR REPLACE PROCEDURE cleanup_password_reset_tokens_de50d19f()
LANGUAGE plpgsql
AS $$
BEGIN
PERFORM net.http_post(
url:=current_setting('app.supabase_url') || '/functions/v1/cleanup-password-reset-tokens',
headers:=jsonb_build_object('Content-Type', 'application/json'),
body:='{"edge_function_name":"cleanup-password-reset-tokens"}',
timeout_milliseconds:=10000
);
COMMIT;
END;
$$;

SELECT cron.schedule('cleanup-password-reset-tokens_invoke', '0 2 * * *', 'CALL cleanup_password_reset_tokens_de50d19f()');
